import React from 'react';
import data from '../data/logement.json'; // Assurez-vous que le chemin est correct

function Home() {
  return (
    <div>
      {data.map(logement => (
        <div key={logement.id} style={{ marginBottom: '20px' }}>
          <img src={logement.cover} alt={logement.title} style={{ width: '100%', height: 'auto', borderRadius: '10px' }} />
          <h3>{logement.title}</h3>
        </div>
      ))}
    </div>
  );
}

export default Home;
